				["36010"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "The Iron Horde, and the Burning Blade clan in particular, have forged a unique relationship with Draenor's ancient elementals. They can work with iron and flame in ways that even I don't fully understand.\n\nYet.\n\nLikitung, slay the Burning Blade's highest-ranking artisan: Flamebender Ka'graz. She is down in the very heart of the Black Forge of the Blackrock Foundry, an area known as the Burning Font. If we're lucky, her secrets are codified in a Flamebender's Tome.",
						["count"] = 2,
						["2"] = "Retrieve the Flamebender's Tome from Flamebender Ka'graz in the Blackrock Foundry.",
					},
					["LeaderBoards"] = {
