					["Link"] = "|cffffff00|Hquest:37245:100|h[Whispers in the Darkness]|h|r",
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "If you don't mind, I'm trying VERY hard to prevent all of our worlds from collapsing into the void, AGAIN.\n\nOh, right, you helped me last time, didn't you? Well, you've got great timing. I'm in need of another Gate-Key.\n\nWell? Go on! The infinite horrors of the abyss aren't just going to wait until you've had a nap! Having that many tentacles makes them really antsy.",
						["count"] = 2,
						["2"] = "Find a Void-Gate Key in the Shadowmoon Burial Grounds.",
