				["36012"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Likitung, during the attack on Karabor Iron Horde dreadnaughts looted or sank most of the draenei eastern fleet. A priceless artifact was captured: A genuine Draenic Thaumaturgical Orb.\n\nI must have it! Those orcs don't know what they've got!\n\nMy sources indicate that the orb was aboard a ship that's being retrofitted down in the Dread Grotto beneath the Blackrock Foundry. Search the ship and the area nearby for the Sha'tari Vault that contained the orb. We've got to get it back!",
						["count"] = 2,
						["2"] = "Acquire the Draenic Thaumaturgical Orb from the Dread Grotto in the Blackrock Foundry.",
					},
					["LeaderBoards"] = {
