					["Link"] = "|cffffff00|Hquest:37241:100|h[Lessons of the Past]|h|r",
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "I have returned! You must have known that a world so rich in history could not keep me away for long!\n\n<Lorewalker Cho chuckles, holding his enormous belly.>\n\nI have perhaps been taking part in too many celebratory feasts, now that the Vale has been cleansed. There is so much to celebrate in Pandaria!\n\nShould you find any future evidence of titanic influence on the native species, I will be here, heartily enjoying the roast clefthoof.",
						["count"] = 2,
						["2"] = "Collect an Overgrown Artifact from The Everbloom.",
