				["38568"] = {
					["RewardMoney"] = 77000,
					["Text"] = {
						["1"] = "Whatever be left of da Iron Horde be fallin' back ta Tanaan Jungle, where Gul'dan is turnin' them into sumthun' even worse. A frontal assault be suicide.\n\nBut da seas be open. If we attack by both land an' sea, Gul'dan got ta fall back somwhere. Likitung, it be time ta build a shipyard!\n\nWe need local resources. Go to da Iron Docks. Gazlowe's boys are already there. Gather any equipment ya find, and see if ya can recruit us a proper Horde Shipwright!",
						["count"] = 2,
						["2"] = "Travel to the Iron Docks and speak with Sammy Fivefingers. Your Garrison Flight Master can provide transport.",
					},
					["Link"] = "|cffffff00|Hquest:38568:100|h[We Need a Shipwright]|h|r",
				},
				["35186"] = {
					["RewardMoney"] = 77000,
					["Text"] = {
						["1"] = "Greetings, Likitung.\n\nArchmage Khadgar wishes you to hear an important message.\n\nThe draenei suffered a great betrayal when one of their leaders, Exarch Othaar, revealed himself to be working with the Legion.\n\nIn the hills above Shadowmoon Valley, Othaar, who now goes by the name Socrethar, gathers new recruits to his cause.\n\nArchmage Modera is in charge of this covert operation, which we need your help carrying out.\n\nMeet her in the field, and she will give you the details.",
						["count"] = 2,
						["2"] = "Speak to Bron Skyhorn for a ride to Shadowmoon Valley.",
					},
					["LeaderBoards"] = {
						{
