					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Ey mon!\n\nDe Cenarion Circle sent Zen'kiki out here ta check out dem primals. I woulda been here sooner, but I had a little bit o' trouble gettin' my flight form ta work, mon.\n\nDe plants in dis place... I can hear dem talk. Dey be yellin' all the time. Angry an' violent yellin'.\n\nWould ya bring Zen'kiki back a leaf from dis Everbloom place dey be talkin' about? Maybe I can figure out what dey want.",
