				["13816"] = {
					["RewardMoney"] = 148000,
					["Text"] = {
						["1"] = "Listen, lad!  Azeroth's fate is at stake here.\n\nOur only chance is to get to the Celestial Planetarium in time to find this Algalon and stop him from beaming back any messages to his Titan masters.\n\nLocate the Celestial Planetarium and come back with any information you get.  We might still have some time to prepare for Algalon's arrival.",
						["count"] = 2,
