					["Link"] = "|cffffff00|Hquest:37230:100|h[Bloody Expensive]|h|r",
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Welcome back, commander. The commander is obviously in a great hurry, and certainly the thought of removing their coat or boots or not dripping all over the floor are much too far beyond consideration.\n\nThe commander remembers the acidic solution, yes? Quite effective it was, though one barrel was not enough to remove ALL of the blood stains from the portraits, or the tapestries, or the ceiling.\n\nSurely this must have been the most heroic and viscous battle in recent history.",
