					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Somehow, the Blackrock Clan has forged an alliance with the creatures of fire and stone. I must know how!\n\nSearch the entirety of the Blackrock Foundry. We are looking for stone tablets dating back to the prehistory of Draenor. They will likely be broken apart into fragments that you'll need to assemble by hand. Look for elemental runes carried by high-ranking members of the Iron Horde.\n\nAssemble them and bring me those tablets, Likitung. I will use their power to augment the powers of your ring!",
						["count"] = 2,
						["2"] = "Collect 3 Elemental Tablets. Assemble the tablets by collecting Elemental Runes from bosses in the Blackrock Foundry.",
