				["40237"] = {
					["Text"] = {
						["1"] = "We've had enough! The working conditions in the Foundry are intolerable with all the fire and the ogron and the flames and the fire elementals and infernos and marauding adventurers! But especially the heat.\n\nI've had enough! Me and the boys are going to start a work stoppage but we need to hire some security muscle and the only goon from Highmaul I could get to agree to the job only takes payment in Apexis Crystals.",
