				["36012"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Taankon, during the attack on Karabor Iron Horde dreadnaughts looted or sank most of the draenei eastern fleet. A priceless artifact was captured: A genuine Draenic Thaumaturgical Orb.\n\nI must have it! Those orcs don't know what they've got!\n\nMy sources indicate that the orb was aboard a ship that's being retrofitted down in the Dread Grotto beneath the Blackrock Foundry. Search the ship and the area nearby for the Sha'tari Vault that contained the orb. We've got to get it back!",
						["count"] = 2,
						["2"] = "Acquire the Draenic Thaumaturgical Orb from the Dread Grotto in the Blackrock Foundry.",
					},
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Draenic Thaumaturgical Orb",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:36012:100|h[Reverse Piracy]|h|r",
				},
				["36013"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Somehow, the Blackrock Clan has forged an alliance with the creatures of fire and stone. I must know how!\n\nSearch the entirety of the Blackrock Foundry. We are looking for stone tablets dating back to the prehistory of Draenor. They will likely be broken apart into fragments that you'll need to assemble by hand. Look for elemental runes carried by high-ranking members of the Iron Horde.\n\nAssemble them and bring me those tablets, Taankon. I will use their power to augment the powers of your ring!",
						["count"] = 2,
						["2"] = "Collect 3 Elemental Tablets. Assemble the tablets by collecting Elemental Runes from bosses in the Blackrock Foundry.",
					},
					["LeaderBoards"] = {
						{
							["1"] = "3/3 Elemental Tablet",
							["count"] = 3,
							["3"] = true,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:36013:100|h[Might of the Elemental Lords]|h|r",
				},
				["36010"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "The Iron Horde, and the Burning Blade clan in particular, have forged a unique relationship with Draenor's ancient elementals. They can work with iron and flame in ways that even I don't fully understand.\n\nYet.\n\nTaankon, slay the Burning Blade's highest-ranking artisan: Flamebender Ka'graz. She is down in the very heart of the Black Forge of the Blackrock Foundry, an area known as the Burning Font. If we're lucky, her secrets are codified in a Flamebender's Tome.",
						["count"] = 2,
						["2"] = "Retrieve the Flamebender's Tome from Flamebender Ka'graz in the Blackrock Foundry.",
					},
					["LeaderBoards"] = {
						{
							["1"] = "0/1 Flamebender's Tome",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:36010:100|h[Flamebender's Tome]|h|r",
				},
				["38415"] = {
					["RewardMoney"] = 154000,
					["Text"] = {
						["1"] = "Your ally, Liadrin, has sent a missive requesting aid near Auchindoun. The Sargerei have made a new assault there and breached something important. It is no coincidence this happened after Gul'dan's ascendancy. We will watch the front here, commander.",
						["count"] = 2,
						["2"] = "Meet Liadrin at Auchindoun in Talador.",
					},
					["Currencies"] = {
						{
							["1"] = "Oil",
