					["Link"] = "|cffffff00|Hquest:36912:-1|h[Capturing a Clefthoof]|h|r",
					["RewardMoney"] = 308000,
					["Text"] = {
						["1"] = "Greetings, friend. I have been told that you are in need of a master of beasts. I come from the icy slopes of Northrend to finally shake this snow from my fur.\n\nThis savage land holds many creatures that we may tame so that our forces may ride on formidable war mounts. The mighty clefthoof reminds me of the mammoths from my home. Take this lasso and head out to the northern reaches of Frostfire Ridge. Mount up and use it to capture one of the young beasts.",
						["count"] = 2,
						["2"] = "Use the Clefthoof Lasso on a Young Icehoof and follow it until it is tamed.",
					},
					["Currencies"] = {
						{
							["1"] = "Garrison Resources",
