				["34209"] = {
					["RewardMoney"] = 13000,
					["Text"] = {
						["1"] = "A matter of great importance has arisen. While you were away, Archmage Khadgar contacted me.\n\nHe is investigating demonic influences to the north.\n\nBeing a human, the Frostwolves will not accept Khadgar without you there to vouch for him, nor will they accept a night elf such as myself.\n\nI will wait for you outside Throm'var in the Frostwind Crag.",
						["count"] = 2,
						["2"] = "Meet Cordana Felsong outside of Thom'var in the Frostwind Crag.",
