						["1"] = "The robot is in bad shape. It was built with several sockets which, like the Blingtron 4000, presumably once carried gems, but are now empty.\n\nThe robot's otherwise dust-covered posterior region contains a small, shiny metal plaque, embossed with the words:\n\nRETURN TO BRAWLER'S GUILD",
