					["RewardMoney"] = 308000,
					["Text"] = {
						["1"] = "It is foolish to pursue Gul'dan with magical means alone. But thanks to you we have a prisoner: Garona. If we can break Gul'dan's mind-control over her, we will learn all his secrets.\n\nI can do it, but I'll need some powerful spell components.\n\nFirst on the list is the heart of an elemental fury. There's one imprisoned in the center of the Blackrock Foundry. Fight your way in, destroy the furnace, and slay the elemental within.",
