					["Text"] = {
						["1"] = "When the sign of the emissary shines in the night sky, the stars strengthen existing bonds and forge new ones. Friendship is still not cheaply won, and deeds will prove loyalty, but trust comes more readily during these days. Venture deep into caverns and strongholds to prove your worth.",
