				["27596"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 The Heart of the Mountain",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cff40c040|Hquest:27596:55|h[The Heart of the Mountain]|h|r",
					["RewardMoney"] = 8325,
					["Text"] = {
						["1"] = "For years I have sought a certain gem.  It is called the Heart of the Mountain and it's the size of your fist!  The Dark Iron dwarves have it locked in their vault and, try as I may, they won't let me purchase it.\n\nSo I must resort to force.\n\nFight your way to The Black Vault near the Hall of Crafting, breach its secret safe and gain the Heart.  To do that, you must defeat Watchman Doomgrip, and he won't appear until you've opened every relic coffer in the vault!\n\nGood luck.",
						["count"] = 2,
						["2"] = "Obtain the Heart of the Mountain.",
					},
					["RewardXP"] = 140,
				},
				["9410"] = {
					["RewardXP"] = 9700,
					["Text"] = {
						["1"] = "Even our best tracking wolves' senses can fail them, Dejkon.  The spirits have a way of seeing the world differently than ours.  The being you will call forth will find the person you seek, for they'll be drawn not to their scent but their essence.\n\nGo now, mage, take this totem with you and use it at the location you found the stone axe.",
						["count"] = 2,
						["2"] = "Use the Wolf Totem at the location where you found Krun Spinebreaker's body and follow the Ancestral Spirit Wolf.",
					},
					["LeaderBoards"] = {
						{
							["1"] = "Use the Wolf Totem at the location where you found Krun Spinebreaker's body and follow the Ancestral Spirit Wolf.",
							["count"] = 3,
							["3"] = true,
							["2"] = "log",
						}, -- [1]
					},
					["Link"] = "|cffffff00|Hquest:9410:62|h[A Spirit Guide]|h|r",
				},
				["9498"] = {
					["Text"] = {
						["1"] = "My people recently finished building Falcon Watch, a base of operations in the southwestern region of Hellfire Peninsula - beyond Hellfire Citadel.  You are welcome there as an ally, Dejkon.\n\nIf you're looking for work, go there and tell Ranger Captain Venn'ren that I sent you.  He will see to it that you're given tasks worthy of someone of your caliber.",
						["count"] = 2,
						["2"] = "Report to Ranger Captain Venn'ren at Falcon Watch in Hellfire Peninsula.",
					},
					["RewardXP"] = 975,
					["Link"] = "|cffffff00|Hquest:9498:62|h[Falcon Watch]|h|r",
				},
				["27585"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/1 General Angerforge slain",
							["count"] = 3,
							["3"] = false,
							["2"] = "monster",
						}, -- [1]
						{
							["1"] = "0/1 Golem Lord Argelmach slain",
							["count"] = 3,
							["3"] = false,
							["2"] = "monster",
						}, -- [2]
					},
					["Link"] = "|cff40c040|Hquest:27585:55|h[The 109th Division]|h|r",
					["RewardMoney"] = 8325,
					["Text"] = {
						["1"] = "General Angerforge and Golem Lord Argelmach are directly responsible for the horrific slaughter of the 109th Division of the Kargath Expeditionary Force. There were a lot of good trolls and orcs in that division, many of them my close friends.\n\nWell, young pandaren, it's time for our fallen brothers to at last have their revenge.\n\nUnlock The Shadowforge Lock, go up the stairs and bear left until you reach the West Garrison. Kill Angerforge and Argelmach, and don't you dare show them any mercy.",
						["count"] = 2,
						["2"] = "Kill General Angerforge and Golem Lord Argelmach.",
					},
					["RewardXP"] = 140,
				},
				["NumQuests"] = 7,
				["7926"] = {
					["Link"] = "|cffffff00|Hquest:7926:-1|h[The Darkmoon Faire]|h|r",
					["Currencies"] = {
						{
							["1"] = "Darkmoon Prize Ticket",
							["count"] = 3,
							["3"] = 5,
							["2"] = "Interface\\Icons\\inv_misc_ticket_darkmoon_01",
						}, -- [1]
					},
					["Text"] = {
						["1"] = "The Darkmoon Faire is coming! Experience our thrilling games, win fabulous prizes, have your fortune told!\n\nIf you act right now, you can redeem this voucher for free prize tickets and a copy of the world-famous Darkmoon Adventurer's Guide to help you identify treasures in your travels!\n\nJust hand your voucher to Gelvas Grimegate located inside the Faire.\n\nRight now, the entrance to the Faire is outside Thunder Bluff in Mulgore!",
						["count"] = 2,
						["2"] = "Deliver the Free Ticket Voucher to Gelvas Grimegate, located inside the Darkmoon Faire.",
					},
					["RewardXP"] = 1000,
					["Rewards"] = {
						{
							["1"] = "Darkmoon Adventurer's Guide",
							["count"] = 6,
							["2"] = "Interface\\ICONS\\INV_Misc_Book_16.blp",
							["5"] = true,
							["4"] = -1,
							["3"] = 1,
							["6"] = "|cffffffff|Hitem:71634:0:0:0:0:0:0:0:65:62:0:0:0|h[Darkmoon Adventurer's Guide]|h|r",
						}, -- [1]
					},
				},
				["10538"] = {
					["LeaderBoards"] = {
						{
							["1"] = "0/12 Boiled Blood",
							["count"] = 3,
							["3"] = false,
							["2"] = "item",
						}, -- [1]
					},
					["Link"] = "|cff40c040|Hquest:10538:60|h[Boiling Blood]|h|r",
					["RewardMoney"] = 9000,
					["Text"] = {
						["1"] = "That last experiment was not a complete loss -- I did save a small bit of the blood you brought me.  Now boiled down, it should be free of whatever curses the Bleeding Hollow witches placed on their people's blood.\n\nI need more for study.  Go gather Bleeding Hollow blood from the orcs in Zeth'Gor.  When you've gathered the blood, bring it to their cursed cauldron and boil it.  Bring me the boiled blood.",
						["count"] = 2,
						["2"] = "Use Bleeding Hollow Blood at the Cursed Cauldron to make Boiled Blood.  Bring 12 Boiled Blood to Apothecary Albreck at Spinebreaker Post.",
					},
					["RewardXP"] = 9450,
				},
				["29542"] = {
					["RewardMoney"] = 2800,
					["Text"] = {
						["1"] = "With the Legion to one side and the fel orcs to the other, Thrallmar is going to be overrun if we don't do something about it.\n\nHead west to the Hellfire Ramparts and speak with Stone Guard Stok'ton. He's in charge of a covert operation to start a Horde invasion on the entire citadel.",
						["count"] = 2,
						["2"] = "Speak with Stone Guard Stok'ton in Hellfire Ramparts.",
					},
					["RewardXP"] = 975,
					["Link"] = "|cffffff00|Hquest:29542:62|h[Invading the Citadel]|h|r",
