				["35186"] = {
					["RewardMoney"] = 77000,
					["Text"] = {
						["1"] = "Greetings, Leczyna.\n\nArchmage Khadgar wishes you to hear an important message.\n\nThe draenei suffered a great betrayal when one of their leaders, Exarch Othaar, revealed himself to be working with the Legion.\n\nIn the hills above Shadowmoon Valley, Othaar, who now goes by the name Socrethar, gathers new recruits to his cause.\n\nArchmage Modera is in charge of this covert operation, which we need your help carrying out.\n\nMeet her in the field, and she will give you the details.",
