					["Text"] = {
						["1"] = "Your ally, Liadrin, has sent a missive requesting aid near Auchindoun. The Sargerei have made a new assault there and breached something important. It is no coincidence this happened after Gul'dan's ascendancy. We will watch the front here, commander.",
						["count"] = 2,
