					["Text"] = {
						["1"] = "For over a thousand years, the ogre sorcerer kings maintained an iron grip over their empire using a variety of artifacts. Trusted lieutenants were given magical gems that allowed them to enforce the emperor's will out in the field. These \"Abrogator Stones\" still maintain their power even today, and can be found scattered throughout the Highmaul complex. Sometimes in clusters.\n\nCollect 125 of these Abrogator Stones for me!",
						["count"] = 2,
						["2"] = "Collect 125 Abrogator Stones from creatures in Highmaul. Your garrison followers may also be able to locate stones in certain missions.",
